drop table movie_category;
drop table movie;
drop table category;
drop table movieTSV;

create table movie(
	id SERIAL UNIQUE NOT NULL,
	title varchar(50),
	summary varchar(100),
	description varchar(500));

create table category(
	id SERIAL UNIQUE NOT NULL,
	name varchar(20) UNIQUE);

create table movie_category(
	movie_id bigint REFERENCES movie(id),
	category_id bigint REFERENCES category(id));

create table movieTSV (
	id SERIAL UNIQUE NOT NULL,
	movieTSV TSVector);

create table search (
	id SERIAL UNIQUE NOT NULL,
	query VARCHAR(40),
	executed TIMESTAMP);

CREATE OR REPLACE FUNCTION createMovieTSVProcedure()
  RETURNS trigger AS
$$
	BEGIN
    RETURN NEW;
END;
$$
LANGUAGE 'plpgsql';

CREATE TRIGGER createMovieTSV AFTER INSERT ON movie
	FOR EACH ROW 
	EXECUTE PROCEDURE createMovieTSVProcedure();





